class ApiLibrary{

    GetThumbData = async (videoCode) => {
        
        url = `${window.location.origin}/api/video/thumb/${videoCode}`;
        const json = await (
            await fetch()
        ).json();
        return json.data;
    };
}


export default ApiLibrary;
